import React, { useState, useEffect } from 'react';
import { Globe, Tv, Radio, MapPin, Users, Share2, Twitter, Instagram, Linkedin, Youtube } from 'lucide-react';
import { useLocation, useNavigate } from 'react-router-dom';
import X from '../logos/twitter.png';
import IG from '../logos/instagram.png';
import Linked from '../logos/linkedin.png';
import YT from '../logos/youtube.png';

function SelectPlatforms() {
  const [activeTab, setActiveTab] = useState('all');
  const [selectedPlatforms, setSelectedPlatforms] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const location = useLocation();
  const navigate = useNavigate();
  
  // Get selected channels from navigation state
  const { selectedChannels } = location.state || {};

  useEffect(() => {
    if (!selectedChannels || selectedChannels.length === 0) {
      navigate('/');
    }
  }, [selectedChannels, navigate]);

  const allPlatforms = {
    websites: [
      { id: 'igihe', 
        name: 'Igihe', 
        icon: Globe, 
        iconUrl: "https://igihe.com/IMG/arton151116.png?1620891831" },
      
      { id: 'newtimes', 
        name: 'The New Times', 
        icon: Globe, 
        iconUrl: "data:image/png;base64," },
      
      { id: 'rwandajobs', 
        name: 'Rwanda Jobs', 
        icon: Globe, 
        iconUrl: "https://www.jobinrwanda.com/sites/default/files/xjir_logo.png.pagespeed.ic.mfOyfr98d4.webp" },
      
      { id: 'ktpress', 
        name: 'KT Press', 
        icon: Globe, 
        iconUrl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQhZuCWbaNV_EQ9yYuBHrAx8wxVduxQTMacLA&s" },
      
      { id: 'kigalitoday', 
        name: 'Kigali Today', 
        icon: Globe, 
        iconUrl: "https://www.kigalitoday.com/elections_2024/img/kigalitoday_logo-election_2024_1.png" },
      
      { id: 'inyarwanda', 
        name: 'Inyarwanda', 
        icon: Globe, 
        iconUrl: "data:image/png;base64," },
      
      { id: 'rushyashya', 
        name: 'Rushyashya', 
        icon: Globe, 
        iconUrl: "https://rushyashya.net/wp-content/uploads/2017/11/rushyashya-news-logo.png" },
      
      { id: 'umuseke', 
        name: 'Umuseke', 
        icon: Globe, 
        iconUrl: "https://umuseke.rw/wp-content/uploads/2023/06/Logo_Umuseke-small2.png" },
      
      { id: 'taarifa', 
        name: 'Taarifa News', 
        icon: Globe, 
        iconUrl: "https://taarifa.rw/wp-content/uploads/2025/08/2-2.png" },
      
      { id: 'blogs', 
        name: 'Blogs', 
        icon: Globe, 
        iconUrl: "https://cdn-icons-png.flaticon.com/128/3959/3959425.png" },
    ],
    tv: [
      { id: 'rtv', 
        name: 'RTV', 
        icon: Tv, 
        iconUrl: "https://rba.co.rw/admin/user_data/profile/bc6ba.jpg" },
      
      { id: 'kc2', 
        name: 'KC2', 
        icon: Tv, 
        iconUrl: "data:image/jpeg;base64," },
      
      { id: 'tv10', 
        name: 'TV10', 
        icon: Tv, 
        iconUrl: "https://radiotv10.rw/wp-content/uploads/2024/09/logo_black.webp" },
      
      { id: 'tv1', 
        name: 'TV1', 
        icon: Tv, 
        iconUrl: "data:image/jpeg;base64," }
    ],
    radio: [
      { id: 'radio-rwanda', 
        name: 'Radio Rwanda', 
        icon: Radio, 
        iconUrl: "data:image/png;base64," },
      
      { id: 'kiss-fm', 
        name: 'Kiss FM', 
        icon: Radio, 
        iconUrl: "data:image/png;base64," },
      
      { id: 'royal-fm', 
        name: 'Royal FM', 
        icon: Radio, 
        iconUrl: "data:image/jpeg;base64," },
      
      { id: 'contact-fm', 
        name: 'Contact FM', 
        icon: Radio, 
        iconUrl: "data:image/jpeg;base64," },
      
      { id: 'flash-fm', 
        name: 'Flash FM', 
        icon: Radio, 
        iconUrl: "data:image/png;base64," },
      
      { id: 'isango-star', 
        name: 'Isango Star Radio', 
        icon: Radio, 
        iconUrl: "data:image/png;base64," }
    ],
    billboards: [
      { id: 'akagera-media', 
        name: 'Akagera Media', 
        icon: MapPin, 
        iconUrl: "http://abgafrica.com/wp-content/uploads/2015/08/new-top-logo.jpg" },
      
      { id: 'alliance-media', 
        name: 'Alliance Media', 
        icon: MapPin, 
        iconUrl: "data:image/png;base64," }
    ],
    influencers: [
      { id: 'inf1', 
        name: 'Aime Rwanda 250', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['instagram'] },
      
      { id: 'inf2', 
        name: 'Clapton Kibonke', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['instagram', 'youtube', 'twitter'] },
      
      { id: 'inf3', 
        name: 'Nishimwe Naomi', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['instagram', 'youtube'] },
      
      { id: 'inf4', 
        name: 'Solange Nishimwe', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['instagram', 'youtube', 'twitter'] },
      
      { id: 'inf4', 
        name: 'Ngabo Karegeya', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['twitter'] },
      
      { id: 'inf5', 
        name: 'Zuba Mutesi', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['instagram', 'youtube', 'twitter'] },
      
      { id: 'inf6', 
        name: 'The Long Form', 
        icon: Users, 
        iconUrl: "data:image/jpeg;base64,", 
        platforms: ['youtube', 'twitter'] }
    ],
  };

  const platforms = Object.keys(allPlatforms).reduce((acc, category) => {
    if (selectedChannels.includes(category)) {
      acc[category] = allPlatforms[category];
    }
    return acc;
  }, {});

  const tabs = [
    { id: 'all', label: 'All' },
    ...selectedChannels.map(channel => ({
      id: channel,
      label: channel.charAt(0).toUpperCase() + channel.slice(1)
    }))
  ];

  const getSocialIcon = (platform) => {
    switch (platform) {
      case 'twitter':
        return X;
      case 'instagram':
        return IG;
      case 'linkedin':
        return Linked;
      case 'youtube':
        return YT;
      default:
        return Share2;
    }
  };

  const togglePlatform = (platformId, platformName, category) => {
    const platformData = { platformId, platformName, category };
    setSelectedPlatforms(prev => {
      const exists = prev.find(p => p.platformId === platformId);
      if (exists) {
        return prev.filter(p => p.platformId !== platformId);
      } else {
        return [...prev, platformData];
      }
    });
  };

  const isPlatformSelected = (platformId) => {
    return selectedPlatforms.some(p => p.platformId === platformId);
  };

  const getFilteredPlatforms = () => {
    let filtered;
    if (activeTab === 'all') {
      filtered = Object.entries(platforms).flatMap(([category, items]) =>
        items.map(item => ({ ...item, category }))
      );
    } else {
      filtered = platforms[activeTab]?.map(item => ({ ...item, category: activeTab })) || [];
    }

    if (searchQuery) {
      filtered = filtered.filter(platform =>
        platform.name.toLowerCase().includes(searchQuery.toLowerCase())
      );
    }

    return filtered;
  };

  const handleContinue = () => {
    if (selectedPlatforms.length === 0) {
      alert('Please select at least one platform');
      return;
    }
    
    // Navigate to user info form with selected data
    navigate('/user-info', {
      state: {
        selectedChannels,
        selectedPlatforms
      }
    });
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-gray-50 to-white">
      <div className="max-w-7xl mx-auto px-6 py-20">
        {/* Header */}
        <div className="mb-12 space-y-4">
          <h1 className="text-5xl font-bold text-black leading-tight">
            Which platforms would you like to advertise on?
          </h1>
          <p className="text-lg text-gray-600">
            Select the platforms where you want your ads to appear. You can choose multiple channels.
          </p>
        </div>

        {/* Search and Filter Section */}
        <div className="mb-10 space-y-6">
          {/* Search Bar */}
          <div className="relative">
            <input
              type="text"
              placeholder="Search platforms..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              className="w-full px-5 py-4 pl-12 border border-gray-300 rounded-xl bg-white text-base shadow-sm focus:outline-none focus:ring-2 focus:ring-black focus:border-transparent transition-all"
            />
            <svg
              className="absolute left-4 top-1/2 -translate-y-1/2 h-5 w-5 text-gray-400"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"
              />
            </svg>
          </div>

          {/* Tabs */}
          <div className="flex flex-wrap gap-3">
            {tabs.map(tab => (
              <button
                key={tab.id}
                onClick={() => setActiveTab(tab.id)}
                className={`px-6 py-3 text-sm font-medium rounded-lg transition-all duration-200 ${
                  activeTab === tab.id
                    ? 'bg-black text-white shadow-md'
                    : 'bg-white text-gray-700 border border-gray-300 hover:bg-gray-50 shadow-sm'
                }`}
              >
                {tab.label}
              </button>
            ))}
          </div>
        </div>

        {/* Platforms Grid by Category */}
        {activeTab === 'all' ? (
          <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-3 gap-6 mb-24">
            {Object.entries(platforms).map(([category, items]) => {
              const filteredItems = searchQuery
                ? items.filter(item => item.name.toLowerCase().includes(searchQuery.toLowerCase()))
                : items;

              if (filteredItems.length === 0) return null;

              return (
                <div key={category} className="bg-white w-full border border-gray-200 rounded-2xl shadow-md overflow-hidden">
                  <div className="px-6 py-4 bg-gradient-to-r from-gray-50 to-white border-b border-gray-200">
                    <h2 className="text-lg font-bold text-black capitalize">
                      {category}
                    </h2>
                  </div>
                  <div className="p-4 max-h-[500px] overflow-y-auto">
                    <div className="grid grid-cols-3 gap-4">
                      {filteredItems.map(platform => {
                        const Icon = platform.icon;
                        const isInfluencer = category === 'influencers';
                        const isSelected = isPlatformSelected(platform.id);
                        
                        return (
                          <button
                            key={platform.id}
                            onClick={() => togglePlatform(platform.id, platform.name, category)}
                            className={`flex flex-col items-center gap-3 p-5 border rounded-xl transition-all duration-200 relative hover:shadow-md group ${
                              isSelected
                                ? 'border-black bg-gray-50 shadow-sm'
                                : 'border-gray-200 bg-white hover:border-gray-300'
                            }`}
                          >
                            <div className='relative w-20 h-20 flex items-center justify-center bg-white rounded-lg overflow-hidden'>
                              {platform.iconUrl ? (
                                <img 
                                  src={platform.iconUrl} 
                                  alt={platform.name} 
                                  className="w-full h-full object-contain"
                                  onError={(e) => {
                                    e.target.style.display = 'none';
                                    e.target.nextElementSibling.style.display = 'flex';
                                  }}
                                />
                              ) : null}
                              <div className="hidden w-full h-full items-center justify-center bg-gray-100">
                                <Icon size={32} className="text-gray-400" />
                              </div>
                            </div>
                            <span className="text-xs font-semibold text-gray-900 text-center leading-tight min-h-[32px] flex items-center">
                              {platform.name}
                            </span>
                            {isInfluencer && platform.platforms && (
                              <div className="mt-1 flex items-center gap-1.5">
                                <span className="text-[10px] text-gray-500 font-medium">on</span>
                                <div className="flex -space-x-1.5">
                                  {platform.platforms.map((socialPlatform, idx) => {
                                    const socialIconSrc = getSocialIcon(socialPlatform);

                                    return (
                                      <div
                                        key={socialPlatform}
                                        className="bg-white border-2 border-white rounded-full p-1 shadow-sm"
                                        style={{ zIndex: platform.platforms.length - idx }}
                                      >
                                        <img
                                          src={socialIconSrc}
                                          alt={socialPlatform}
                                          className="w-3.5 h-3.5 object-contain"
                                        />
                                      </div>
                                    );
                                  })}
                                </div>
                              </div>
                            )}
                            {isSelected && (
                              <div className="absolute top-2 right-2 w-5 h-5 bg-black rounded-full flex items-center justify-center">
                                <svg className="w-3 h-3 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={3} d="M5 13l4 4L19 7" />
                                </svg>
                              </div>
                            )}
                          </button>
                        );
                      })}
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        ) : (
          <div className="bg-white border border-gray-200 rounded-2xl shadow-md p-6 mb-24">
            <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 gap-4">
              {getFilteredPlatforms().map(platform => {
                const Icon = platform.icon;
                const isInfluencer = platform.category === 'influencers';
                const isSelected = isPlatformSelected(platform.id);
                
                return (
                  <button
                    key={platform.id}
                    onClick={() => togglePlatform(platform.id, platform.name, platform.category)}
                    className={`flex flex-col items-center gap-3 p-5 border rounded-xl transition-all duration-200 relative hover:shadow-md group ${
                      isSelected
                        ? 'border-black bg-gray-50 shadow-sm'
                        : 'border-gray-200 bg-white hover:border-gray-300'
                    }`}
                  >
                    <div className='relative w-24 h-24 flex items-center justify-center bg-white rounded-lg overflow-hidden'>
                      {platform.iconUrl ? (
                        <img 
                          src={platform.iconUrl} 
                          alt={platform.name} 
                          className="w-full h-full object-contain"
                          onError={(e) => {
                            e.target.style.display = 'none';
                            e.target.nextElementSibling.style.display = 'flex';
                          }}
                        />
                      ) : null}
                      <div className="hidden w-full h-full items-center justify-center bg-gray-100">
                        <Icon size={40} className="text-gray-400" />
                      </div>
                    </div>
                    <span className="text-sm font-semibold text-gray-900 text-center leading-tight min-h-[40px] flex items-center px-2">
                      {platform.name}
                    </span>
                    {isInfluencer && platform.platforms && (
                      <div className="mt-1 flex items-center gap-1.5">
                        <span className="text-[10px] text-gray-500 font-medium">on</span>
                        <div className="flex -space-x-1.5">
                          {platform.platforms.map((socialPlatform, idx) => {
                            const socialIconSrc = getSocialIcon(socialPlatform);

                            return (
                              <div
                                key={socialPlatform}
                                className="bg-white border-2 border-white rounded-full p-1 shadow-sm"
                                style={{ zIndex: platform.platforms.length - idx }}
                              >
                                <img
                                  src={socialIconSrc}
                                  alt={socialPlatform}
                                  className="w-3.5 h-3.5 object-contain"
                                />
                              </div>
                            );
                          })}
                        </div>
                      </div>
                    )}
                    {isSelected && (
                      <div className="absolute top-3 right-3 w-6 h-6 bg-black rounded-full flex items-center justify-center">
                        <svg className="w-3.5 h-3.5 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={3} d="M5 13l4 4L19 7" />
                        </svg>
                      </div>
                    )}
                  </button>
                );
              })}
            </div>
          </div>
        )}

        {/* Fixed Bottom Bar */}
        {selectedPlatforms.length > 0 && (
          <div className="fixed bottom-0 left-0 right-0 bg-white border-t border-gray-200 shadow-2xl">
            <div className="max-w-7xl mx-auto px-6 py-5">
              <div className="flex items-center justify-between">
                <div className="text-sm">
                  <span className="font-semibold text-black text-lg">
                    {selectedPlatforms.length} platform{selectedPlatforms.length !== 1 ? 's' : ''} selected
                  </span>
                  <span className="text-gray-500 ml-2">
                    Ready to continue
                  </span>
                </div>
                <button
                  onClick={handleContinue}
                  className="bg-black text-white px-10 py-4 font-semibold rounded-lg hover:bg-gray-800 transition-all shadow-md hover:shadow-lg"
                >
                  Continue
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default SelectPlatforms;